import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
// root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
// );

function Clock(props) {
    return (
      <div>
        <h2>This is Clock!</h2>
        <h3>Time is {props.date.toLocaleTimeString()}</h3>
      </div>
    )
}

function tick() {
  root.render(
    <React.StrictMode>
    <App />
    <Clock date={new Date()} />
  </React.StrictMode>
  );
}

setInterval(tick, 0);
